import React from 'react';
import "./getStarted.css";

const GetStarted = () => {
  return (
    <div class = "content">
        <div class = "getStarted">
            Welcome to Marketplace Game!
            <button class = "searchButtonMain">
                Start
            </button>
        </div>
        <div class = "animation">
            <img 
            src={require('./../../assets/placeholder.jpg')} 
            alt = "placeholder"
            width="400"
            />
        </div>
    </div>  
  ) 
}

export default GetStarted;
